use serde::{Deserialize, Serialize};#[derive(Deserialize)]#[derive(Debug)]pub struct SSL {    pub chain_file: String,    pub private_key_file: String,    pub private_password: String,    pub dhparam_file: String,    pub verify_file: String,}impl  Clone for SSL{    fn clone(&self) -> Self {       Self{           chain_file: self.chain_file.clone(),           private_key_file: self.private_key_file.clone(),           private_password: self.private_password.clone(),           dhparam_file: self.dhparam_file.clone(),           verify_file: self.verify_file.clone()       }    }}impl Default for SSL{    fn default() -> Self {        Self{            chain_file: "".to_string(),            private_key_file: "".to_string(),            private_password: "".to_string(),            dhparam_file: "".to_string(),            verify_file: "".to_string()        }    }}